import { combineReducers } from "redux";

import discoverReducer from "./discoverReducer";
import asianDramasReducer from "./mediaListReducers/asianDramasReducer";
import popularTVReducer from "./mediaListReducers/popularTVReducer";
import nowPlayingReducer from "./mediaListReducers/nowPlayingReducer";
import studioghibliReducer from "./mediaListReducers/studioghibliReducer";
import upcomingReducer from "./mediaListReducers/upcomingReducer";
import topRatedReducer from "./mediaListReducers/topRatedReducer";

export default combineReducers({
  movies: {
    discover: discoverReducer,
    nowPlaying: nowPlayingReducer,
    studioGhibli: studioghibliReducer,
    upcoming: upcomingReducer,
    topRated: topRatedReducer
  },
  tvs: {
    asianDramas: asianDramasReducer,
    popular: popularTVReducer
  }
});
